            <div className="orco4">PRODUCTS</div>
            <div className="orco5">PRICE</div>
            <div className="orco6">SUB-TOTAL</div>
           </div>
           <div className="orco7">
            <div className="orco8"><p>2023 Apple MacBook Pro with Apple</p> <p>M2 Chip (13-inch, 16GB RAM, 512GB</p><p> SSD Storage) - Space Gary</p></div>
            <div className="orco9"><span className="orco12">$2000</span><span className="orco11">$1800</span></div>
            <div className="orco10">$1800</div>
           </div>
        </div>}
    </div>
  );
};

export default Order2component;
